
 
 
create table Usuario (
UserID int  not null AUTO_INCREMENT,
nombre varchar(15) not null,
email varchar(30),  
password varchar(15),  
permisos varchar(1) not null,
CONSTRAINT Usuario_clave_primaria PRIMARY KEY (UserID));

create table Partida (
GameID int  not null AUTO_INCREMENT,
nombre varchar(15) not null,
User1 int,  
User2 int,
Autor int,
faccion1 int,  
faccion2 int,  
fecha TIMESTAMP DEFAULT NOW(),  
lugar varchar(50),  
tipo int default 0,
estadoInicial LONGTEXT,
eventos LONGTEXT,
gameArea int default 0,
CONSTRAINT Partida_clave_primaria PRIMARY KEY (GameID));

 
create table Modelo (
ModelID int AUTO_INCREMENT,
model_infactionId int,
nombre varchar(40),  
icono_path varchar(100),
textura_path varchar(100),
size int,
perfil varchar(30),
faccion int,
constraint Modelo_clave_primaria primary key(ModelID));
 

create table Faccion (
FaccionID int,
nombre varchar(40),  
icon_path varchar(100),
constraint Faccion_clave_primaria primary key(FaccionID));
 

create table GameArea(
GameAreaId int AUTO_INCREMENT,
autor int default 0,
data LONGTEXT,
PRIMARY KEY (GameAreaId));


create table Visualizaciones(	
VisualizacionID int AUTO_INCREMENT,
gameID int default 0,
ultimoEvento int default 0,
fechaDeVisualiado date,
primary key(VisualizacionID));






